collections::vec_deque::VecDeque::<T, A>.doc:
Returns the number of elements the deque can hold without
reallocating.

# Examples

```
use std::collections::VecDeque;

let buf: VecDeque<i32> = VecDeque::with_capacity(10);
assert!(buf.capacity() >= 10);
```

